import React from "react";
import DeleteIcon from '@material-ui/icons/Delete'; 
function Note({title,content,id,deleteCLick}) {
  return (
    <div className="note">
      <h1>{title}</h1>
      <p>{content}</p>
      <button onClick={()=>deleteClick(id)}>
      <DeleteIcon />
      </button>
    </div>
  );
}

export default Note;
